  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:20.985810\",\n\t\"name\": \"narrative-report-for-sullys-hill-national-game-preserve-and-easement-refuges-of-district-n-d5723\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sullys
  Hill National Game Preserve and Easement Refuges of District No. 2 outlines Refuge
  accomplishments during the 1966 calendar year.  The report begins by summarizing
  the weather conditions, habitat conditions, and food and cover conditions during
  the year. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  and vegetation control. Resource management is outlined; topics include grazing,
  haying, and timber removal. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
  safety. Items of interest and photographs are attached.\",\n\t\"license_title\":
